part3_src/activation_layer.html.body:
activation_layer.c
layer make_activation_layer(int batch, int inputs, ACTIVATION activation)
{
    layer l = {0};
    l.type = ACTIVE;

    l.inputs = inputs;
    l.outputs = inputs;
    l.batch=batch;

    l.output = calloc(batch*inputs, sizeof(float*));
    l.delta = calloc(batch*inputs, sizeof(float*));

    l.forward = forward_activation_layer;
    l.backward = backward_activation_layer;

    l.activation = activation;
    fprintf(stderr, "Activation Layer: %d inputs\n", inputs);
    return l;
}


activation layer를 만드는 함수 입니다.

void forward_activation_layer(layer l, network net)
{
    copy_cpu(l.outputs*l.batch, net.input, 1, l.output, 1);
    activate_array(l.output, l.outputs*l.batch, l.activation);
}

void backward_activation_layer(layer l, network net)
{
    gradient_array(l.output, l.outputs*l.batch, l.activation, l.delta);
    copy_cpu(l.outputs*l.batch, l.delta, 1, net.delta, 1);
}


순전파, 역전파를 위한 함수 입니다.

part3_src/activations_1.html.body:
Activation Function 이란?
퍼셉트론과 딥러닝의 차이점
딥러닝 네트워크에서 Layer사이에 항상 활성화 함수(Activation Function)가 있습니다. 이러한 activation function은 어떤 역할을 하는 것 일까요?
활성화 함수란 값을 활성화시키는 비선형 함수 입니다.
비선형 함수가 활성화 함수의 핵심 입니다.
만약 딥러닝 네트워크에 활성화 함수가 없고 선형 함수만 존재하는 경우 Layer를 아무리 추가해도 결국은 하나의 Layer가 있는 네트워크와 같게 됩니다. ( a(a(ax + b) + b) + b = ax' + b )
즉, 딥러닝 네트워크는 활성화 함수의 존재로 Layer가 깊어질 수 있고 수많은 연산으로 많은 것을 표현할 수 있게 됩니다.

activations.c
// darknet.h

typedef enum{
    LOGISTIC, RELU, RELIE, LINEAR, RAMP, TANH, PLSE, LEAKY, ELU, LOGGY, STAIR, HARDTAN, LHTAN, SELU
} ACTIVATION;


enum : 열거형, 정수형 상수를 선언할 때 일일이 선언하지 어려운 부분을 해결하기 위한 키워드 입니다.

위에 열거형의 경우 이름은 ACTIVATION이고 LOGISTIC : 0 ... SELU : 13 값이 할당 됩니다.
