GRU layer 란?
GRU는 Gated Recurrent Units의 약자입니다. LSTM과 유사한 구조로 한국에서 개발 된 모듈입니다.
LSTM과 유사하지만 2개의 gate로 이루어져 있고 더 간단한 구조입니다.

성능면에서 유사하지만 LSTM보다 적은 학습 파라미터를 갖는 것이 장점입니다.

